            ["100"]: {
                name: 'BackLog',
                items: [{
                        id: uuid(),
                        content: 'Make Dought',
                        description: 'desc...',
                        estimation: 0,
                        color: 'gold'
                    },

                    {
                        id: uuid(),
                        content: 'Cook the Dought',
                        description: 'desc...',
                        estimation: 0,
                        color: 'blue'
                    }
                ]
            },
            [uuid()]: {
                name: 'Sprint Backlog',
                items: []
            },
            [uuid()]: {
                name: 'Done',
                items: [{
                    id: uuid(),
                    content: 'Buy Hoven',
                    description: 'desc...',
                    estimation: 0,
                    color: 'Salmon'
                }]
            },
        },
        sprints: {
            [uuid()]: {
                name: 'Sprint Backlog',
                items: []
            },
            [uuid()]: {
                name: 'Done',
                items: [{
                    id: uuid(),
                    content: 'Old Item',
                    description: 'desc...',
                    estimation: 10,
                    color: 'Lightblue'
                }]
            },
        }
    },

    {
        id: uuid(),
        name: 'Web Project',
        active: {
            ["100"]: {
                name: 'BackLog',
                items: [{
                        id: uuid(),
                        content: 'Make Dought',
                        description: 'desc...',
                        estimation: 0,
                        color: 'gold'
                    },

                    {
                        id: uuid(),
                        content: 'Cook the Dought',
                        description: 'desc...',
                        estimation: 0,
                        color: 'blue'
                    }
                ]
            },
            [uuid()]: {
                name: 'Sprint Backlog',
                items: []
            },
        },
        sprints: {
            [uuid()]: {
                name: 'Sprint Backlog',
                items: [{
                    id: uuid(),
                    content: 'publish website',
                    description: 'desc...',
                    estimation: 10,
                    color: 'Tomato'
                }]
            },
            [uuid()]: {
                name: 'To test',
                items: [{
                    id: uuid(),
                    content: 'make a index.html',
                    description: 'desc...',
                    estimation: 10,
                    color: 'Lightblue'
                }]
            },
            [uuid()]: {
                name: 'Done',
                items: [{
                    id: uuid(),
                    content: 'brainstorm ideas',
                    description: 'desc...',
                    estimation: 1,
                    color: 'green'
                }]
            },
        }
    },
];

export const visible = { visibility: 'visible' };
